import React, { Component } from 'react';
import { Route, Switch } from 'react-router'
import ActiveMailingList from 'ActiveMailingList';
import CameraView from 'Camera';
import ManualUserAdd from 'ManualUserAdd';

class Navigation extends Component {
  render() {
    return (
      <div className="row">
        <div className="col">
          <Switch>
            <Route exact path='/' component={ActiveMailingList}/>
            <Route exact path='/camera' component={CameraView}/>
            <Route exact path='/manual' component={ManualUserAdd}/>
          </Switch>
        </div>
      </div>
    );
  }
}

export default Navigation;
